import styled from "styled-components";

export const Calandar_Styles = styled.div`
  overflow: scroll;
  .Calendar_Day_Container {
    margin-top: 2em;
  }

  .Calendar_Day_Heading {
    font-family: "Poiret One", cursive;
  }
  .Calandar_Event_Container {
    display: flex;
    padding: 1em;
  }

  .Calandar_Event {
    border: 1px solid;
    padding: 1em;
    border-radius: 3px;
  }
  .Calandar_Event_Teams {
    display: flex;
    margin-top: 0.5em;
    margin-bottom: 0.5em;
  }
  h3 {
    display: flex;
    align-items: center;
  }
  .Icon {
    margin-right: 0.5em;
  }
`;

export const UserOverview_Styles = styled.div`
  color: black;
  padding-top: 1em;
  padding-bottom: 1em;
  display: flex;
  justify-content: space-between;
  height: initial;
  border-bottom: 1px solid;
  opacity: 0.5;

  h3 {
    border-left: 1px solid;
    padding-left: 10px;
  }

  & > * {
    display: flex;
    align-items: center;
  }
`;
